import './App.css';
import Header from './components/Header';
import Nav from './components/Nav';
import Footer from './components/Footer';

const menu = [
  {
    title: 'item1',
    link: '/item1'
  },
  {
    title: 'item2',
    link: '/item2'
  },
  {
    title: 'item3',
    link: '/item3'
  },
  {
    title: 'item4',
    link: '/item4'
  },
  {
    title: 'item5',
    link: '/item5'
  }
];

function App() {
  return (
    <div className="App">
      <Header></Header>
      <Nav items={menu}></Nav>
      <Footer></Footer>
    </div>
  );
}

export default App;
